intakes_trend_1.query:
q = load "${App.Datasets.ERM_Lead_tp.FullyQualifiedName}";
q = filter q by 'IsContactTracing' == "True" or 'IsSelfReported' == "True";
result = group q by ('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day');
result = foreach result generate q.'CreatedDate_Year' + "~~~" + q.'CreatedDate_Month' + "~~~" + q.'CreatedDate_Day' as 'CreatedDate_Year~~~CreatedDate_Month~~~CreatedDate_Day', count(q) as 'Daily';
result = group result by 'CreatedDate_Year~~~CreatedDate_Month~~~CreatedDate_Day';
result = foreach result generate 'CreatedDate_Year~~~CreatedDate_Month~~~CreatedDate_Day', first(Daily) as 'Daily', sum(sum(Daily)) over([..0] partition by 'all' order by 'CreatedDate_Year~~~CreatedDate_Month~~~CreatedDate_Day' asc) as 'Cumulative';
 result = foreach result generate 'CreatedDate_Year~~~CreatedDate_Month~~~CreatedDate_Day', '{{cell(static_1.selection, 0, "value").asString()}}';
result = order result by ('CreatedDate_Year~~~CreatedDate_Month~~~CreatedDate_Day' asc);
result = limit result 2000;

CreatedDate_Year_Cre_1.query:
