result = group q by ('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day');
result = foreach result generate q.'CreatedDate_Year' + "~~~" + q.'CreatedDate_Month' + "~~~" + q.'CreatedDate_Day' as 'CreatedDate_Year~~~CreatedDate_Month~~~CreatedDate_Day', count(q) as 'A';
result = group result by 'CreatedDate_Year~~~CreatedDate_Month~~~CreatedDate_Day';
result = foreach result generate 'CreatedDate_Year~~~CreatedDate_Month~~~CreatedDate_Day', first(A) as 'Daily', sum(sum(A)) over ([..0] partition by all order by ('CreatedDate_Year~~~CreatedDate_Month~~~CreatedDate_Day')) as 'Cumulative';
result = foreach result generate 'CreatedDate_Year~~~CreatedDate_Month~~~CreatedDate_Day', '{{cell(static_2.selection, 0, "value").asString()}}';
result = order result by ('CreatedDate_Year~~~CreatedDate_Month~~~CreatedDate_Day' asc);
result = limit result 2000;

Intakes_KPI_bar_1.query:
q = load "${App.Datasets.ERM_Lead_tp.FullyQualifiedName}";
q_A = filter q by 'IsContactTracing' == "True";
q_B = filter q by 'IsSelfReported' == "True";
q_F = filter q by 'IsConverted' == "true" && ('IsContactTracing' == "True" || 'IsSelfReported' == "True");
result = group q_A by all full, q_B by all full, q_F by all;
result = foreach result generate count(q_A) as 'ContactTraced', count(q_B) as 'SelfReported', count(q_F) as 'Converted';
result = foreach result generate 'ContactTraced', 'SelfReported', 'Converted', ContactTraced+ SelfReported as 'ExposedIndividuals', SelfReported/(ContactTraced+ SelfReported) as 'SelfReported_Per', ContactTraced/(ContactTraced+ SelfReported) as 'ContactTracing_Per', Converted/(ContactTraced+ SelfReported) as 'Converted_Per';
result = limit result 2000;
